css:
@font-face {
  font-family: "Press Start 2P";
  src: url("atom://activate-power-mode/fonts/PressStart2P-Regular.ttf") format("truetype");
}
.power-mode-canvas {
  position: absolute;
  z-index: 0;
  top: 0;
  left: 0;
  pointer-events: none;
}
atom-text-editor .scroll-view {
  will-change: transform;
}
.streak-container {
  font-family: "Press Start 2P", sans-serif;
  position: absolute;
  z-index: 10;
  right: 20px;
  top: 5px;
  text-align: right;
  pointer-events: none;
}
.streak-container .title {
  color: white;
  text-shadow: 2px 2px 2px #4EFFA1;
  font-size: 16px;
}
.streak-container .max {
  color: #4EFFA1;
  font-size: 13px;
}
.streak-container .bar {
  position: relative;
  opacity: 0.5;
  margin-top: 10px;
  height: 8px;
  background: #4EFFA1;
  width: 100%;
  transform: scaleX(0);
}
.streak-container .counter {
  margin-top: 10px;
  font-size: 60px;
  color: #4EFFA1;
  line-height: 1;
}
.streak-container .counter.bump {
  animation: grow 0.25s both;
}
.streak-container .exclamations {
  position: absolute;
  bottom: -10px;
  right: 0;
  display: block;
  color: #4EFFA1;
  opacity: 0.75;
  font-size: 20px;
  text-align: right;
}
.streak-container .exclamations .exclamation {
  right: 0;
  top: 0;
  display: block;
  position: absolute;
  min-width: 200px;
  animation: exclamation 1.5s ease-out both;
}
.streak-container .exclamations .exclamation.message,
.streak-container .exclamations .exclamation.error,
.streak-container .exclamations .exclamation.level,
.streak-container .exclamations .exclamation.max-combo {
  margin-right: 40px;
}
.streak-container .exclamations .exclamation.up,
.streak-container .exclamations .exclamation.down {
  font-size: 15px;
}
.streak-container .exclamations .exclamation.down,
.streak-container .exclamations .exclamation.error {
  color: #ee3c3c;
}
.streak-container .exclamations .exclamation.level,
.streak-container .exclamations .exclamation.max-combo {
  color: #ffed4b;
}
.streak-container.level-5 .title {
  text-shadow: 2px 2px 2px #ff4ebb;
}
.streak-container.level-5 .counter,
.streak-container.level-5 .exclamations,
.streak-container.level-5 .max {
  color: #ff4ebb;
}
.streak-container.level-5 .bar {
  background: #ff4ebb;
}
.streak-container.level-4 .title {
  text-shadow: 2px 2px 2px #dc4eff;
}
.streak-container.level-4 .counter,
.streak-container.level-4 .exclamations,
.streak-container.level-4 .max {
  color: #dc4eff;
}
.streak-container.level-4 .bar {
  background: #dc4eff;
}
.streak-container.level-3 .title {
  text-shadow: 2px 2px 2px #754eff;
}
.streak-container.level-3 .counter,
.streak-container.level-3 .exclamations,
.streak-container.level-3 .max {
  color: #754eff;
}
.streak-container.level-3 .bar {
  background: #754eff;
}
.streak-container.level-2 .title {
  text-shadow: 2px 2px 2px #4e8fff;
}
.streak-container.level-2 .counter,
.streak-container.level-2 .exclamations,
.streak-container.level-2 .max {
  color: #4e8fff;
}
.streak-container.level-2 .bar {
  background: #4e8fff;
}
.streak-container.level-1 .title {
  text-shadow: 2px 2px 2px #4ef6ff;
}
.streak-container.level-1 .counter,
.streak-container.level-1 .exclamations,
.streak-container.level-1 .max {
  color: #4ef6ff;
}
.streak-container.level-1 .bar {
  background: #4ef6ff;
}
@keyframes grow {
  0% {
    animation-timing-function: ease-out;
  }
  50% {
    transform: scale(1.3);
    animation-timing-function: ease-in;
  }
}
@keyframes exclamation {
  100% {
    opacity: 0;
    transform: translate3D(0, 100px, 0);
  }
}
.effect-list li,
.plugin-list li {
  height: auto;
  margin-left: auto;
  margin-right: auto;
  padding-bottom: 20px;
  overflow: hidden;
}
.effect-list li img,
.plugin-list li img {
  max-width: 80px;
  max-height: 80px;
  float: right;
}
#activate-power-mode\.particles\.effect,
#activate-power-mode\.flow {
  pointer-events: none;
}
